// menuSistema.jsx
import React from "react";
import { Link, BrowserRouter, Route, Switch } from "react-router-dom";
import { Menu } from "semantic-ui-react";

class MenuSistema extends React.Component {
   state = {
       activeItem: 'home'
   }

   handleItemClick = (e, { name }) => this.setState({ activeItem: name })

   render() {
       return (
           <BrowserRouter>
               <Menu inverted>
                   <Menu.Item
                       name='home'
                       active={this.state.activeItem === 'home'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/'
                   />
                   <Menu.Item
                       name='cliente'
                       active={this.state.activeItem === 'cliente'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/list-cliente'
                   />
                   <Menu.Item
                       name='produto'
                       active={this.state.activeItem === 'produto'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/list-produto'
                   />
                   <Menu.Item
                       name='entregador'
                       active={this.state.activeItem === 'entregador'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/list-entregador'
                   />
                   <Menu.Item
                       name='material'
                       active={this.state.activeItem === 'material'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/list-material'
                   />
                   <Menu.Item
                       name='comprador'
                       active={this.state.activeItem === 'comprador'}
                       onClick={this.handleItemClick}
                       as={Link}
                       to='/list-comprador'
                   />
               </Menu>

               {/* Define the Routes inside the BrowserRouter */}
               <Switch>
                   <Route path="/list-cliente" component={ListCliente} />
                   <Route path="/list-produto" component={ListProduto} />
                   <Route path="/list-entregador" component={ListEntregador} />
                   <Route path="/list-material" component={ListMaterial} />
                   <Route path="/list-comprador" component={ListComprador} />
                   <Route path="/" component={Home} exact />
               </Switch>
           </BrowserRouter>
       )
   }
}

export default MenuSistema;
